const binaryString = '...'; // binary string representation of the file
const mimeType = 'image/png'; // MIME type of the file
const blob = binaryToFile(binaryString, mimeType);
const url = URL.createObjectURL(blob);
const a = document.createElement('a');
a.href = url;
a.download = 'file.png';
a.click();
